import React from 'react';
import { useNavigate } from 'react-router-dom';

const Benefits = () => {

    const navigate = useNavigate();
    const startApp = () => {
        navigate('/');
    }

    return (
        <>
            <div className='tile'>
                <button className='blue-button' onClick={startApp}>Apply</button>
            </div>
        </>
    )
}
export default Benefits;
